func divideArray(nums []int, k int) [][]int {

	// 排序
	//nums = sortBuddle(nums)
	sort.Ints(nums)
	rlt := [][]int{}
	// 分割
	for i := 0; i <= len(nums)/3; i++ {
		tailIndex := (i + 1) * 3
		if tailIndex > len(nums) {
			tailIndex = len(nums)
		}
		subNums := nums[i*3 : tailIndex]
		if len(subNums) < 2 {
			continue
		}

		// 如果有2个以上数字, 需要计算差值
		// 如果差值大于k, 直接break 返回空
		tail := subNums[1]
		if len(subNums) > 2 {
			tail = subNums[2]
		}
		if tail-subNums[0] > k {
			return [][]int{}
		}
		rlt = append(rlt, subNums)
	}
	return rlt
}

func sortBuddle(nums []int) []int {
	length := len(nums)
	if length <= 1 {
		return nums
	}

	head := 0
	for head < length-1 {
		changed := false
		tail := length - 1
		for tail > head {
			if nums[tail] < nums[tail-1] {
				temp := nums[tail-1]
				nums[tail-1] = nums[tail]
				nums[tail] = temp

				changed = true
			}
			tail--
		}
		if !changed {
			break
		}
		head++
	}
	return nums
}
